import React, {useEffect, useState} from 'react'
import {Navbar, Form, Button} from 'react-bootstrap'

function NavbarToolbox() {

    const [textInput, setTextInput] = useState('')
    const [textList, setTextList] = useState([])

    const handleSend = (event) => {
        event.preventDefault();
        setTextList(textList => [...textList, textInput])
        setTextInput('')
        
    }

    return (
        <Navbar className="bg-danger justify-content-center py-3">
            <Form inline onSubmit={handleSend}>
                <Form.Control 
                    type="text" 
                    style={{width: 600}} 
                    placeholder="Insert Text" 
                    className="mr-4"
                    value={textInput}
                    onChange={e=>setTextInput(e.target.value)}
                />
                <Button type="submit" className="px-5">Send</Button>
            </Form>
        </Navbar>
    )

}

export default NavbarToolbox
